reportWebVitals();
import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import AnotherComponent from './AnotherComponent';

// 기본 root 엘리먼트에 App 컴포넌트 렌더링
ReactDOM.render(
  <React.StrictMode>
    <React.StrictMode>
    <BrowserRouter>
    <App />
    </BrowserRouter>
    </React.StrictMode>
  </React.StrictMode>,
  document.getElementById('root')
);

// another-root 엘리먼트에 AnotherComponent 컴포넌트 렌더링
const anotherRoot = document.getElementById('another-root');
if (anotherRoot) {
  ReactDOM.render(
    <React.StrictMode>
      <BrowserRouter>
      <AnotherComponent />
      </BrowserRouter>
    </React.StrictMode>,
    anotherRoot
  );
}
